import "./App.css";
import Card from "./components/Landing/Card.js";
// import experience list stored as an array of objects in CardData.js
import data from "./CardData";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Nav from "./components/Nav";
import About from "./components/About";
import Contact from "./components/Contact";
import Features from "./components/Features";

function App() {

  return (
    <div className="container">
      <Router>
        <div>
          <Nav />
          <main>
            <Routes>
              {/* Define each route to load the appropriate component */}
              <Route path="/about" element={<About />} />
              <Route path="/contact" element={<Contact />} />
              <Route path="/features" element={<Features />} />
            </Routes>
          </main>
        </div>
      </Router>
      <section className="section-experience-list">
        {/* Call  the array that stores JSX elements of card */}
        {cards}
      </section>
    </div>
  );
}

// export to index.js
export default App;
